$templateCache.put("app/fragments/search.html","<div layout=\"row\" layout-margin layout-align=\"center\">\n    <md-input-container flex=\"70\">\n        <label for=\"novo-time\">Nome do time</label>\n        <input id=\"novo-time\" type=\"text\" ng-model=\"new_time\"/>\n    </md-input-container>\n    <div flex=\"initial\">\n        <md-button class=\"md-flat md-mini\" ng-click=\"search.search(new_time)\">\n            Adicionar Time\n        </md-button>\n    </div>\n</div>");
